This uses f.server_conn.address for filtering, but f.server_conn.address isn't IP address. It's host name.
So I need to add another filter which uses f.server_conn.ip_address.

```
class FDst(_Rex):
    code = "dst"
    help = "Match destination address"
    is_binary = False

    def __call__(self, f):
        if not f.server_conn or not f.server_conn.address:
            return False
        r = "{}:{}".format(f.server_conn.address[0], f.server_conn.address[1])
