This is very confusing.
So for now, I've made the menu appear only for the selected flow.", 'comment_created': datetime.datetime(2021, 6, 13, 13, 39, 42, tzinfo=datetime.timezone.utc), 'commenter': 'gorogoroumaru', 'type': 'User'}, {'comment_id': 650597425, 'comment_body': "I made a mistake. I'll fix it.", 'comment_created': datetime.datetime(2021, 6, 14, 0, 22, 23, tzinfo=datetime.timezone.utc), 'commenter': 'gorogoroumaru', 'type': 'User'}, {'comment_id': 654457724, 'comment_body': 'Let's use the `useDispatch` hook here: https://react-redux.js.org/tutorials/quick-start#use-redux-state-and-actions-in-react-components. This allows us to keep keep `FlowRow` "clean" and we don't need to specify all actions in FlowRow.jsx. üòÉ 

For `state.settings.intercept` it's a bit more tricky as we want FlowRow to be cached/memoized. If we use `useSelector` in a child component, my understanding is that the child component will not be rerendered on changes (because the parent FlowRow is cached), so we cannot do that. I think we can however move the logic from `InterceptThis` into an action creator like this:

`ducks/settings.js`
```javascript
export function addInterceptFilter(e) {
    return (dispatch, getState) => {
        let intercept = getState().settings.intercept;
        // logic here
        dispatch(updateSettings({ intercept }));
    }
}    
```

Then we can just `dispatch(addInterceptFilter(...))` here and don't need any state. Does that make sense to you? Otherwise ping me on Slack and I'll try to explain it better. :)', 'comment_created': datetime.datetime(2021, 6, 18, 14, 4, 10, tzinfo=datetime.timezone.utc), 'commenter': 'mhils', 'type': 'User'}, {'comment_id': 654459406, 'comment_body': "Really nice. üëç  I didn't know this is so easy nowadays. üòÅ ", 'comment_created': datetime.datetime(2021, 6, 18, 14, 6, 16, tzinfo=datetime.timezone.utc), 'commenter': 'mhils', 'type': 'User'}, {'comment_id': 654460475, 'comment_body': "I think right after this PR is complete we should add an API endpoint to execute commands. We can then get rid of this one as it's basically the same as invoking a particular command. But that's work for the next PR, not this one. üòÉ ", 'comment_created': datetime.datetime(2021, 6, 18, 14, 7, 36, tzinfo=datetime.timezone.utc), 'commenter': 'mhils', 'type': 'User'}]
